import React, { useContext, useState } from 'react';
import { AuthContext } from '../context/authContext';
import Logo from './logo';

const GestionIncidencias = () => {
  const { setAuth } = useContext(AuthContext);
  const [incidencias, setIncidencias] = useState([
    { id: 'I105', detalles: 'Detalles de la incidencia I105' },
    { id: 'I106', detalles: 'Detalles de la incidencia I106' },
    { id: 'I107', detalles: 'Detalles de la incidencia I107' },
  ]);

  const handleLogout = () => {
    setAuth(null);
  };

  const styles = {
    container: {
      fontFamily: 'Arial, sans-serif',
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
    },
    title: {
      backgroundColor: '#ffd700',
      color: 'black',
      padding: '10px',
      textAlign: 'center',
    },
    section: {
      marginBottom: '20px',
      padding: '15px',
      borderRadius: '5px',
    },
    input: {
      width: '100%',
      padding: '5px',
      marginBottom: '10px',
    },
    button: {
      backgroundColor: '#4a5d23',
      color: 'white',
      border: 'none',
      padding: '10px 15px',
      cursor: 'pointer',
      marginRight: '10px',
    },
    textarea: {
      width: '100%',
      padding: '5px',
      marginBottom: '10px',
      minHeight: '100px',
    },
  };

  return (
    <div style={styles.container}>
      <Logo />
      <h1 style={styles.title}>GESTIÓN DE INCIDENCIAS</h1>

      <div style={{...styles.section, backgroundColor: '#e6f3e6'}}>
        <h2>VER INCIDENCIAS</h2>
        {incidencias.map((incidencia) => (
          <div key={incidencia.id}>
            <span>{incidencia.id}</span>
            <button style={styles.button}>Ver + Detalles</button>
          </div>
        ))}
        <textarea style={styles.textarea} placeholder="DETALLE DE INCIDENCIA" readOnly></textarea>
      </div>

      <div style={{...styles.section, backgroundColor: '#f0f0f0'}}>
        <h2>CREAR INCIDENCIA</h2>
        <input style={styles.input} type="text" placeholder="ID INCIDENCIA" />
        <input style={styles.input} type="text" placeholder="ID ASIGNACIÓN" />
        <input style={styles.input} type="text" placeholder="RUT USUARIO" />
        <textarea style={styles.textarea} placeholder="DESCRIPCIÓN"></textarea>
        <input style={styles.input} type="text" placeholder="ESTADO" />
        <input style={styles.input} type="date" placeholder="FECHA" />
        <button style={styles.button}>Crear incidencia</button>
      </div>

      <div style={{...styles.section, backgroundColor: '#e6f3e6'}}>
        <h2>ACTUALIZAR INCIDENCIA</h2>
        <input style={styles.input} type="text" placeholder="ID INCIDENCIA" />
        <button style={styles.button}>Buscar</button>
        <textarea style={styles.textarea} placeholder="DETALLE DE INCIDENCIA"></textarea>
        <select style={styles.input}>
          <option value="">ESTADO</option>
          <option value="pendiente">Pendiente</option>
          <option value="en_proceso">En Proceso</option>
          <option value="resuelto">Resuelto</option>
        </select>
        <button style={styles.button}>Actualizar estado</button>
      </div>

      <div style={{...styles.section, backgroundColor: '#f0f0f0'}}>
        <h2>ELIMINAR INCIDENCIA</h2>
        <input style={styles.input} type="text" placeholder="ID INCIDENCIA" />
        <textarea style={styles.textarea} placeholder="DETALLE DE INCIDENCIA" readOnly></textarea>
        <button style={styles.button}>Buscar</button>
        <button style={styles.button}>Eliminar Incidencia</button>
      </div>

      <button style={{...styles.button, display: 'block', margin: '20px auto'}} onClick={handleLogout}>
        VOLVER AL PANEL
      </button>
    </div>
  );
};

export default GestionIncidencias;
